import React from 'react';
import { NavLink } from 'react-router-dom';

const NavigationBar = () => {
  const activeStyle = {
    fontWeight: 'bold',
    textDecoration: 'underline',
  };

  return (
    <nav style={{ padding: '10px', borderBottom: '1px solid #ccc', marginBottom: '20px' }}>
      <NavLink to="/" style={({ isActive }) => (isActive ? activeStyle : undefined)} end>
        Home
      </NavLink>{' '}
      |{' '}
      <NavLink to="/stories" style={({ isActive }) => (isActive ? activeStyle : undefined)}>
        Stories
      </NavLink>{' '}
      |{' '}
      <NavLink to="/articles" style={({ isActive }) => (isActive ? activeStyle : undefined)}>
        Articles
      </NavLink>{' '}
      |{' '}
      <NavLink to="/speakout" style={({ isActive }) => (isActive ? activeStyle : undefined)}>
        Speak Out
      </NavLink>{' '}
      |{' '}
      <NavLink to="/resources" style={({ isActive }) => (isActive ? activeStyle : undefined)}>
        Resources
      </NavLink>{' '}
      |{' '}
      <NavLink to="/get-involved" style={({ isActive }) => (isActive ? activeStyle : undefined)}>
        Get Involved
      </NavLink>{' '}
      |{' '}
      <NavLink to="/contact" style={({ isActive }) => (isActive ? activeStyle : undefined)}>
        Contact
      </NavLink>
    </nav>
  );
};

export default NavigationBar;
